var com_redbassett_category_image={run:function(){$("a[name*=category]").each(function(){var e=$(this).attr("name");e=+e.replace("category-","");for(var t=0;t<proboards.plugin.get("category_image").settings.categories.length;t++){if(e==proboards.plugin.get("category_image").settings.categories[t].category[0]){$(this).next().find("div.title-bar").css({"background-image":"url("+proboards.plugin.get("category_image").settings.categories[t].image+")"}).text("")}}})}};$(document).ready(function(){com_redbassett_category_image.run()})